import { useState } from 'react';


function MyComponent() {
    const [text, setText] = useState<string>('Initial Text');

    return (
        <div>
            <h1>{text}</h1>
            <button onClick={() => setText('Hello, world!')}>
                Click me
            </button>
        </div>
    );
}

export default MyComponent;
